uniform vec2 s_col;
uniform vec4 d_Col;
uniform vec4 s_Col;

uniform vec2 d_im;
uniform vec2 s_im;
uniform vec4 d_Im;
uniform vec4 s_Im;

uniform int C1;
uniform int H1;
uniform int W1;
uniform int KH;
uniform int KW;
uniform int DH;
uniform int DW;
uniform int SH;
uniform int SW;
uniform int PH;
uniform int PW;

